        new FireC3,
        new WaterC1,
        new EarthC4,
        new WindC4,
);

var enemy = new Player(
        new AtomicC4,
        new FireC1,
        new WaterC1,
        new EarthC4,
        new WindC4,
);


test_abilityFireC3(player, enemy);

